(22, 3, 'Plantes grasses', 'Cactus', NULL, 2, 'Non', 0, 12, 12, 0, 'Le minimalisme étant à la mode d’aujourd’hui, la tendance est à l’invitation du cactus à la maison ou au bureau ou encore au jardin. Exotique, ses lignes et courbes graphiques s’adaptent à la décoration des intérieurs contemporains.', , 'Cactus');
