(23, 2, 'Fleurs', 'Fleurs non comestibles', NULL, 3, 'Promotion sur les rosiers', 0.2, 25, 50, 10, 'Un rosier de star, et la star des rosiers! Avec son port érigé et ses fleurs rose indien aux nuances saumonées et son parfum complexe qui associe la rose, le citron, la framboise, l’abricot avec quelques notes de verveine et de cyprès, ce rosier a tout !', , 'Rosier');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
(28, 3, 'Plantes grasses', 'Succulentes', NULL, 2, 'non', NULL, 24.9, 53, 3, 'Très populaire dans nos intérieurs, la crassula ovata est coiffée d\'un magnifique feuillage succulent qui lui donne toute son élégance. Autrement appelée arbre de Jade, c\'est une plante succulente qui se cultive aussi bien en intérieur qu\'en extérieur.', , 'Crassula Ovata');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
(29, 3, 'Plantes grasses', 'Succulentes', NULL, 2, NULL, NULL, 27.5, 15, 3, 'Particulièrement délicate et aérienne, le senecio serpens est une plante succulente idéale à l\'intérieur. Avec ses feuilles argentées, il apporte une belle luminosité à la pièce pour mettre en valeur votre déco. Coiffé de petits poils fins qui le protège', , 'Senecio Serpens');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
(30, 2, 'Fleurs', 'Fleurs non comestibles', NULL, 2, NULL, NULL, 39.9, 8, 3, 'Le Dendrobium nobilee Sea Mary à à 2 branches est une orchidée qui se démarque par son originalité et sa finesse. Cette plante est très admirée par son lingue et exceptionnelle floraison d’un violet tendre nuancé de blanc. Entre l’hiver et le printemps, ', , 'Orchidée Dendrobium nobilee Sea Mary');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
(31, 2, 'Fleurs', 'Fleurs non comestibles', NULL, 2, NULL, NULL, 30.5, 12, 3, 'Plante tropicale à la beauté exotique et raffinée, l’Anthurium royal white champion est une variété originale qui saura vous séduire. Même si elle demande quelques soins, elle sera très facile à cultiver même par les jardiniers les plus novices. Elle se ', , 'Anthurium royal White Champion');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
(32, 1, 'Arbres', 'Arbres fruitiers', NULL, 1, 'promo arbuste', 0.3, 11.9, 34, 5, 'Plus grosse, plus rustique, plus goûteuse. Vous n’y résisterez pas !\r\nLe framboisier ‘Marastar\' est un petit fruit obtenu par notre pépiniériste Marionnet, spécialiste des petits fruits et créateur de l’inimitable fraise ‘Mara des Bois’.', , 'Framboisier remontant Marastar');
INSERT INTO `produit` (`idProduit`, `idCat`, `nomCategorie`, `nomSousCat`, `idAdmin`, `idPromo`, `nomPromo`, `txPromo`, `prix`, `stock`, `seuilStockAlerte`, `description`, `photo`, `nomProduit`) VALUES
